import { createIcon } from "../icon/createIcon";

export const ArrowDownIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="ArrowDownIcon">
    <path d="M7 0v8h3l-4 4-4-4h3V0h2z" />
  </svg>,
  "ArrowDown",
  "arrow down"
);
